import React, { useState } from "react";
import MovieList from './Movie';

const App = () => {
  const [movies] = useState([
    {
		"Title": "Ask Tesadüfleri Sever",
		"Year": "2011",
		"imdbID": "tt1807950",
		"Type": "movie",
		"Poster": "https://m.media-amazon.com/images/M/MV5BMjAwMjMyMzQzMV5BMl5BanBnXkFtZTcwNDE4MTc1NQ@@._V1_SX300.jpg"
	},
    {
      Title: "Star Wars: Episode V - The Empire Strikes Back",
      Year: "1980",
      imdbID: "tt0080684",
      Type: "movie",
      Poster:
        "https://m.media-amazon.com/images/M/MV5BYmU1NDRjNDgtMzhiMi00NjZmLTg5NGItZDNiZjU5NTU4OTE0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SX300.jpg",
    },
    {
      Title: "Star Wars: Episode VI - Return of the Jedi",
      Year: "1983",
      imdbID: "tt0086190",
      Type: "movie",
      Poster:
        "https://m.media-amazon.com/images/M/MV5BOWZlMjFiYzgtMTUzNC00Y2IzLTk1NTMtZmNhMTczNTk0ODk1XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg",
    },
	{
		"Title": "The Bugs Bunny/Looney Tunes Comedy Hour",
		"Year": "1985–1986",
		"imdbID": "tt0088491",
		"Type": "series",
		"Poster": "https://m.media-amazon.com/images/M/MV5BMDEwNTAwNjMtNTgwZC00Y2RjLTliOTYtZWI4NGNlNjI4ZTVjXkEyXkFqcGdeQXVyMTA0MTM5NjI2._V1_SX300.jpg"
	},
	{
		"Title": "Comedy Central Roast of Charlie Sheen",
		"Year": "2011",
		"imdbID": "tt1985970",
		"Type": "movie",
		"Poster": "https://m.media-amazon.com/images/M/MV5BYmI3ZGQzMTEtZjg3Zi00MmNlLWI3MTgtNDdkMDAxODFmOTQxXkEyXkFqcGdeQXVyNDgyODgxNjE@._V1_SX300.jpg"
	},
  ]);

  return (
    <div className="container-fluid movie-app">
      <div className="row" style={{marginTop: '3rem', display: 'flex', flexDirection: 'row', justifyContent: 'space-evenly', alignItems: 'center', flexWrap: 'wrap'}}><MovieList movies={movies} /></div>
    </div>
  );
};

export default App;
